import { StyleSheet, Text, View } from 'react-native'
import { Vaga } from '../models/vaga'

export default function VagaDetalhes() {
    const [vaga, setVaga] = useState<Vaga>()
    return (
        <View>
            <Text></Text>
        </View>
    )
}

const styles = StyleSheet.create({})
